SELECT COUNT(*) as agg_0 FROM "corporation" LEFT OUTER JOIN "region" ON "corporation"."region_no" = "region"."region_no" LEFT OUTER JOIN "member" ON "region"."region_no" = "member"."region_no" LEFT OUTER JOIN "charge" ON "member"."member_no" = "charge"."member_no"  WHERE "charge"."catery_no" <= 17 AND "corporation"."corp_name" NOT LIKE '%Trans%itAg.%' AND "corporation"."corp_no" >= 189